import React, { Component } from "react";


const Casa = props => {
    return (
        <div>
            <h1>{this.props.show}</h1>
            {
                React.Children.map(
                    this.props.Children,
                    (personagem) => {
                        return React.cloneElement(
                            personagem,
                            { casa: this.props.casa }
                        )
                    }
                )
            }
        </div>
    )
}



